    const show = ()=>{
        updateOpen(!open)
    }
    return (
        <div className="list_box">
            <NavLink to={data.path} className="nav_list"> {data.title}
                <div className="arrow">
                    {
                        data.up
                    }
                </div>
            </NavLink>
        </div>
    )
}

